import React from 'react';

function Header(){
    return (
        <header style={styles}>This is the homepage header</header>
    )
}

const styles = {

    backgroundColor: 'black',
    color:'white',
    height: 100,
    boxShadow:"1px 3px 5px #9E9E9E",
    fontSize: 30,
    textAlign: 'center',
    alignItems: 'center'
}

export default Header;
